import { Routes, Route } from 'react-router-dom';
import { CartItemPage } from './pages';
import { CARTITEM_ROUTE } from './untils/consts';

function App() {
  return (
    <div>
      {' '}
      <Router>
        <Routes>
          <Route path="/" element={CartItemPage}></Route>
        </Routes>
      </Router>
    </div>
  );
}

export default App;
